import React from "react";
import './MovieThumb.css';
class MovieThumb extends React.Component {
    render(){
        return(
            <section>
                <div className="listBox">

                    <p> {this.props.id}   {this.props.title}  {this.props.rating} </p>
                </div>
            </section>
        );
    }

}

export default MovieThumb;
